import PropTypes from 'prop-types'

const Logo = ({ logo, title }) => {

    return (
        <div className='flex items-center'>
            <img src={logo} className="mr-5  h-7" />

            <span className='self-center text-xl font-semibold whitespace-nowrap text-white' >
                {title}
            </span>

         
        </div>

    )
}


export default Logo
